import React from 'react'
import {Button, Form, Icon, Input} from 'antd';
const FormItem = Form.Item;

export default class Login extends React.Component {

  render() {

    const simpleData = (props,context) => {

        return () => {
          context.callback();
        }
    };

    return(
        <div>
            <Form className="login">
              <FormItem>
                <Input prefix={<Icon type="user"/>} id="sd" placeholder="学号"/>
              </FormItem>
              <FormItem>
                <Input prefix={<Icon type="lock"/>} id="pw" type="password" placeholder="密码"/>
              </FormItem>
              <FormItem>
                <Button htmlType="submit" className="login-form-button"  onClick="graduateResult()">查询</Button>
              </FormItem>
            </Form>
        </div>
    )
  }
}
